import { IDashboardData } from "../alias/IDashboardData";

const DashboardData: IDashboardData = {
  professionalCount: "4",
  tyepOfProfessionalCount: "3",
  LastRegisteredProfessional: "Lucas Carvalho",
  LastRegisteredTyepOfProfessional: "Engineer",
};

export function getDashboardData(): Promise<IDashboardData> {
  return new Promise(async function (resolve, reject) {
    setTimeout(() => {
      resolve(DashboardData);
    }, 1000);
  });
}
